import fond from './images/fond.png';
import './musique.css';


function Musique() {


  return (
    

    <div className="div_musique">
        <div className='container'>
          <span className='fond_ico'></span>

        </div>

        <span>

          <img src={fond} className='fond_musique'></img>
        </span>


        










    </div>
    
  );
}

export default Musique;
// export { totalArticle };
